function setup(){document.onclick=function(e){return e.target!=document.getElementById("sideButton")&&e.target!=document.getElementById("sideContent")?void closeOnly():void 0}}function changeClass(){var e=document.getElementById("sideContent").className;"closed"==e?document.getElementById("sideContent").className="open":"open"==e?document.getElementById("sideContent").className="closed":alert("Object has unknown class!")}function closeOnly(){var e=document.getElementById("sideContent").className;"open"==e&&(document.getElementById("sideContent").className="closed")}window.addEventListener("load",setup(),!1);
